import requests

url = "https://de-fi-crypto-currency-exchange.p.rapidapi.com/swap/{blockchainid}"
querystring = {"walletAddress": walletaddress, "gasPrice": gasprice, "gaslimit": gaslimit, "toTokenAddress": totokenaddress, "amountTrade": amounttrade, "fromTokenAddress": fromtokenaddress, "slippage": slippage}

headers = {
    "X-RapidAPI-Key": "SIGN-UP-FOR-KEY",
    "X-RapidAPI-Host": "de-fi-crypto-currency-exchange.p.rapidapi.com"
}

response = requests.get(url, headers=headers, params=querystring)

print(response.json())

